<!DOCTYPE html>
<html lang="ko">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>MA 미션계 신청 시스템</title>
    <style>
        :root { --p: #ff0000; --bg: #050505; --t: #ccc; --box: #111; }
        body { background: var(--bg); color: var(--t); font-family: 'Pretendard', sans-serif; display: flex; justify-content: center; padding: 20px; margin: 0; }
        .container { width: 100%; max-width: 500px; background: var(--box); padding: 40px; border: 1px solid #222; box-shadow: 0 0 30px rgba(255,0,0,0.1); }
        h1 { color: var(--p); text-align: center; letter-spacing: 5px; margin-bottom: 30px; font-size: 1.5rem; border-bottom: 1px solid #333; padding-bottom: 15px; }
        
        /* 카테고리 선택기 */
        .mode-selector { margin-bottom: 30px; background: #000; padding: 15px; border: 1px solid var(--p); border-radius: 4px; }
        .mode-selector label { color: var(--p); font-weight: bold; font-size: 11px; display: block; margin-bottom: 5px; }
        
        /* 폼 섹션 애니메이션 */
        .form-section { display: none; }
        .form-section.active { display: block; animation: fadeIn 0.4s ease; }
        @keyframes fadeIn { from { opacity: 0; } to { opacity: 1; } }

        .group { margin-bottom: 20px; }
        label { display: block; font-size: 12px; color: #888; margin-bottom: 8px; font-weight: 600; }
        input, select, textarea { width: 100%; padding: 12px; background: #000; border: 1px solid #333; color: #fff; box-sizing: border-box; border-radius: 2px; }
        input:focus { border-color: var(--p); outline: none; }
        
        /* 미디어 업로드 구역 */
        .upload-zone { border: 2px dashed #444; padding: 25px; text-align: center; background: #000; cursor: pointer; transition: 0.3s; }
        .upload-zone:hover { border-color: var(--p); background: #0a0000; }
        .file-list { font-size: 11px; color: #00ff00; margin-top: 10px; display: none; background: #001a00; padding: 10px; border: 1px solid #004400; text-align: left; line-height: 1.6; }

        .dynamic-field { background: #1a1a1a; padding: 15px; border-radius: 4px; margin-top: 10px; border-left: 3px solid var(--p); }
        
        /* 제출 버튼 */
        button { width: 100%; padding: 20px; background: var(--p); color: #fff; border: none; font-weight: bold; cursor: pointer; margin-top: 30px; letter-spacing: 3px; font-size: 1rem; text-transform: uppercase; }
        button:hover { background: #b30000; box-shadow: 0 0 20px rgba(255,0,0,0.5); }
        button:disabled { background: #444; cursor: not-allowed; box-shadow: none; }

        .footer { font-size: 11px; color: #444; text-align: center; margin-top: 25px; text-transform: uppercase; }
    </style>
</head>
<body>

<div class="container">
    <h1>MA 미션계 신청</h1>

    <div class="mode-selector">
        <label>SELECT CATEGORY</label>
        <select id="mainCategory" onchange="switchCategory()">
            <option value="mission">개인미션</option>
            <option value="archive">박제요청</option>
        </select>
    </div>

    <form id="gateForm">
        <div id="missionSection" class="form-section active">
            <div class="group">
                <label>미션 인증 (동영상 / 사진 필수)</label>
                <div class="upload-zone" onclick="document.getElementById('m_files').click()">
                    <span style="font-size: 0.8rem; color: #666;">게시글에 있는 미션을 완료한 영상 또는 동영상을 첨부해주세요.</span>
                    <input type="file" id="m_files" name="m_files" multiple style="display:none" onchange="showFiles('m')">
                    <div id="m_file_info" class="file-list"></div>
                </div>
            </div>
            <div class="group">
                <label>SNS 계정 아이디</label>
                <input type="text" id="m_sns" placeholder="Instagram, Twitter 등등. (개인미션 전송에 사용됩니다.)">
            </div>
            <div class="group">
                <label>난이도</label>
                <select id="m_lv"><option>쉬움</option><option>중간</option><option>어려움</option><option>인생포기</option></select>
            </div>
            <div class="group">
                <label>장소 (1 ~ 10 랜덤 선택)</label>
                <input type="number" id="m_loc" min="1" max="10" placeholder="1부터 10 사이에 번호를 랜덤으로 선택해주세요.">
            </div>
            <div class="group">
                <label>시간대</label>
                <select id="m_time"><option>아침</option><option>점심</option><option>저녁</option><option>새벽</option></select>
            </div>
            <div class="group">
                <label>본인 성별</label>
                <select id="m_gender"><option>여성</option><option>남성</option></select>
            </div>
            <div class="group">
                <label>선호 취향</label>
                <input type="text" id="m_pref" placeholder="예: 수치, 야외노출">
            </div>
            <div class="group">
                <label>자위기구 사용</label>
                <select id="m_toy"><option>O</option><option>X</option></select>
            </div>
        </div>

        <div id="archiveSection" class="form-section">
            <div class="group">
                <label>박제 인증 (신분증(선택) + 전신 2장 + 얼굴 필수)</label>
                <div class="upload-zone" onclick="document.getElementById('a_files').click()" style="border-color: #550000;">
                    <span style="font-size: 0.8rem; color: #666;">본인임을 증명할 수 있는 사진 3장 이상을 첨부해주세요.</span>
                    <input type="file" id="a_files" name="a_files" multiple style="display:none" onchange="showFiles('a')">
                    <div id="a_file_info" class="file-list"></div>
                </div>
            </div>
            <div class="group">
                <label>실명</label>
                <input type="text" id="a_name" placeholder="본인 실명을 입력해주세요.">
            </div>
            <div class="group">
                <label>나이</label>
                <input type="number" id="a_age" placeholder="만 나이를 입력해주세요.">
            </div>
            <div class="group">
                <label>성별 선택</label>
                <select id="a_gender" onchange="updateAnatomy()">
                    <option value="">성별 선택</option>
                    <option value="female">여성</option>
                    <option value="male">남성</option>
                </select>
            </div>
            <div id="anatomyField" class="dynamic-field" style="display:none;">
                <div class="group">
                    <label>키 / 몸무게</label>
                    <input type="text" id="a_body" placeholder="165 / 50">
                </div>
                <div id="breastBox" class="group" style="display:none;">
                    <label style="color: #ff7777;">가슴 크기</label>
                    <input type="text" id="a_breast" placeholder="예: 75C">
                </div>
                <div id="penisBox" class="group" style="display:none;">
                    <label style="color: #7777ff;">자지 크기</label>
                    <input type="text" id="a_penis" placeholder="예: 15cm">
                </div>
            </div>
            <div class="group">
                <label>거주지</label>
                <input type="text" id="a_addr" placeholder="아파트 및 동/호수 상세히 입력해주세요.">
            </div>
            <div class="group">
                <label>직업</label>
                <input type="text" id="a_job" placeholder="없다면 X 적어주세요.">
            </div>
            <div class="group">
                <label>선호 플레이</label>
                <input type="text" id="a_pref_p" placeholder="야외, 수치 등 좋아하는 플레이를 입력해주세요.">
            </div>
            <div class="group">
                <label>비선호 플레이</label>
                <input type="text" id="a_hate_p" placeholder="야외, 수치 등 싫어하는 플레이를 입력해주세요.">
            </div>
            <div class="group">
                <label>SNS 아이디</label>
                <input type="text" id="a_sns" placeholder="Instagram, Twitter 등">
            </div>
            <div class="group">
                <label>하고 싶은 말</label>
                <textarea id="a_msg" rows="3" placeholder="박제 시 하고 싶은 말을 입력해주세요."></textarea>
            </div>
        </div>

        <button type="submit" id="submitBtn">SEND</button>
    </form>

    <div class="footer">
        모든 데이터는 암호화됩니다.
    </div>
</div>
